import React from "react";
import Link from "next/link";
import PageTitle from "../components/PageTitle";

const Sobre = () => {
  return (
    <div>
      <PageTitle title="sobre" />
      <h1>Sobre</h1>
      <div>
        <Link href="/index">
          <a>Home</a>
        </Link>
        <Link href="/contato">
          <a>Contato</a>
        </Link>
      </div>
    </div>
  );
};

export default Sobre;
